// Adding Polygon to SHPKotaMalangLayer
L.polygon(polygonCoords, { color: 'gold', fillColor: 'lightblue', fillOpacity: 0.1 })
    .addTo(SHPKotaMalangLayer)
    .bindPopup("SHP Kota Malang");


