// Function to add markers and circles for cafes
cafes.forEach(function(cafe) {
    var latlon = proj4("EPSG:32749", "EPSG:4326", cafe.koordinat);
    var lat = latlon[1];
    var lon = latlon[0];

    var customIcon = L.divIcon({
        className: 'custom-marker',
        html: `<div style="background-color: cyan; width: 10px; height: 10px; border-radius: 50%;"></div>`,
        popupAnchor: [0, -30]
    });

    L.marker([lat, lon], { icon: customIcon, title: cafe.nama })
        .addTo(cafeLayer)
        .bindPopup(`<b>Cafe: </b>${cafe.nama}<br><b>Alamat: </b>${cafe.alamat}<br><b>Rate: </b>${cafe.rate}`);

    L.circle([lat, lon], {
        color: 'cyan',
        fillColor: 'darkcyan',
        weight: 0.90,
        fillOpacity: 0.15,
        radius: 500
    }).addTo(cafeLayer).bindPopup("Buffer Radius 500 m");
});

