L.control.layers(baseLayers, overlays).addTo(map);

// Popup for a specific location
var popup = L.popup()
    .setLatLng([-7.982612, 112.630843])
    .setContent("Titik Refrensi")
    .addTo(map);

function onMapClick(e) {
    popup
        .setLatLng(e.latlng)
        .setContent("Kota Malang " + e.latlng.toString())
        .addTo(map);
}

map.on('click', onMapClick);
L.Control.geocoder().addTo(map);

